create table Population (
    id int auto_increment primary key,
    amount int not null,
    countryId int not null,
    yearId int not null,
    constraint Population_ibfk_1 foreign key (yearId) references Year (id),
    constraint Population_ibfk_2 foreign key (countryId) references Country (id)
);

create index countryId on Population (countryId);

create index yearId on Population (yearId);

